    CB_PORTAL.Loader.show('testDetails');
    const id = currentTest.item_id;
    const sensorPayload = currentTest.sensor_payload;
    const description = currentTest.description;
    const startDate = currentTest.start_date;
    const endDate = currentTest.end_date ? currentTest.end_date : 'None specified';
    const type = datasources.FoodTestTypes.latestData().find((type) => type.data.item_id === currentTest.type_id).data.name;
    let sensor;
    let customer;
    let location;
    let tester;
    return datasources.getSensorById.sendData({ "sensor_id": currentTest.sensor_id }).then((res) => {
        if (res.err) {
            CB_PORTAL.Loader.hide('testDetails');
            $("#testDetailError").css('display', 'initial');
        } else {
            sensor = res.results.payload.DATA[0].sensor_name;
            return datasources.getCustomers.sendData({ "customer_id": currentTest.customer_id }).then((res) => {
                if (res.err) {
                    CB_PORTAL.Loader.hide('testDetails');
                    $("#testDetailError").css('display', 'initial');
                } else {
                    customer = res.results.payload.DATA[0].name;
                    return datasources.getEmployeeById.sendData({ "email": currentTest.tester_id }).then((res) => {
                        if (res.err) {
                            CB_PORTAL.Loader.hide('testDetails');
                            $("#testDetailError").css('display', 'initial');
                        } else {
                            tester = res.results.payload ? res.results.payload[0].email : 'None specified';
                            return datasources.getLocationById.sendData({ "location_id": currentTest.location_id }).then((res) => {
                                if (res.err) {
