                                    $(".testID").text(id);
                                    $(".tester").text(tester);
                                    $(".testType").text(type);
                                    $(".testSensor").text(sensor);
                                    $(".testSensorPayload").text(sensorPayload);
                                    $(".testCustomer").text(customer);
                                    $(".testLocation").text(location);
                                    $(".testStart").text(new Date(startDate).toLocaleString());
                                    $(".testEnd").text(new Date(endDate).toLocaleString());
                                    $(".testDescription").text(description);
                                }
                            })
                        }
                    })
                }
            })
        }
