function getBase64(file) {
    if (file) {
       return new Promise((resolve, reject) => {
            const reader = new FileReader();
            reader.readAsDataURL(file);
            reader.onload = () => resolve(reader.result);
            reader.onerror = error => reject(error);
        }); 
    } else {
        const currentEmployee = datasources.getEmployees.latestData().results.payload.find(l => l.item_id === datasources.currentEmployee.latestData()) 
        return new Promise((resolve, reject) => {
            if (currentEmployee) {
                resolve(currentEmployee.photo);
            } else {
                resolve('');
            }
        });
    }
};

