function getBase64(file) {
    if (file) {
       return new Promise((resolve, reject) => {
            const reader = new FileReader();
            reader.readAsDataURL(file);
            reader.onload = () => resolve(reader.result);
            reader.onerror = error => reject(error);
        }); 
    } else {
        const currentLoc = datasources.getLocations.latestData().results.payload.DATA.find(l => l.item_id === datasources.currentLocation.latestData()) 
        return new Promise((resolve, reject) => {
            if (currentLoc) {
                resolve(currentLoc.icon);
            } else {
                resolve('');
            }
        });
    }
};

