$('input[type=file]').change(function (eve) {
    var t = $(this).val();
    var reader = new FileReader();
    var f = eve.target.files[0]

    // Closure to capture the file information.
    reader.onload = (function (theFile) {
        $('.csv-error').html('')
        $('.csv-success').html('')
        return function (e) {
            let js = $.csv.toObjects(e.target.result)
            // remove empty objects
            js = js.filter(d => Object.values(d).find(el => el !== ''))
                .map(d => (
                    {
                        name: d.name,
                        description: d.description,
                    }
                ))
            CB_PORTAL.Loader.waitFor(datasources.createAssetType.sendData({ asset_types: js }).then(res => {
                if (res.success === false) {
                    $('.csv-error').html(res.results)
                    return
                }
                if (res.results.err) {
                    $('.csv-error').html(res.results.message)
                } else {
                    $('.csv-success').html("Successfully Uploaded")
                    datasources.getAssetTypes.sendData()
                }
            }), 'upload-csv-btn')
        };
    })(f);

    // Read in the image file as a data URL.
    reader.readAsText(f);

})

