//JavaScript
const container = $('#header-title-container');
container.text('Smart Refrigeration');
window.onhashchange = (hashArg) => {
    const hash = window.location.hash;
    if (CB_PORTAL.getPathParams() && CB_PORTAL.getPathParams().TestDetail) {
        const id = CB_PORTAL.getPathParams().TestDetail;
        datasources.getTests.sendData({ "test_id": id }).then((res) => {
            container.text(res.results.payload.DATA[0].name)
        })
    }
    const customer_id = datasources.currentCustomer.latestData().item_id;

    // Hacky fix for forms with dynamic dropdowns no appearing if gone to with browser back
    const newHash = hashArg.newURL.split('#')[1] && hashArg.newURL.split('#')[1].toLowerCase()
    const oldHash = hashArg.oldURL.split('#')[1] && hashArg.oldURL.split('#')[1].toLowerCase()
    if (newHash === '/assets') {
        const currentAssetId = datasources.currentAssetId.latestData();
        datasources.currentAssetId.sendData('none')
        setTimeout(() => {
            datasources.currentAssetId.sendData(currentAssetId)
        }, 0)
    }
    if (newHash === '/sensors') {
        const currentSensor = datasources.currentSensor.latestData();
        datasources.currentSensor.sendData('none')
        datasources.getSensors.sendData({ customer_id })
        setTimeout(() => {
            datasources.currentSensor.sendData(currentSensor)
        }, 0)
    }
    if (newHash === '/gateways') {
        const currentGatewayId = datasources.currentGatewayId.latestData();
        datasources.currentGatewayId.sendData('none')
        setTimeout(() => {
            datasources.currentGatewayId.sendData(currentGatewayId)
        }, 0)
    }
    if (newHash === '/employees') {
        const currentEmployeeAdminPage = datasources.currentEmployeeAdminPage.latestData();
        datasources.currentEmployeeAdminPage.sendData('none')
        setTimeout(() => {
            datasources.currentEmployeeAdminPage.sendData(currentEmployeeAdminPage)
        }, 0)
    }

    if (oldHash === '/alertconfig') {
        // reset data if it's messed up by location sensor searches
        datasources.getSensors.sendData({ customer_id })
        datasources.getAssets.sendData({ customer_id })
    }

    datasources.getAlertConfigurations.sendData({
        customer_id,
    })
}
